using System;
using Xunit;
using ShipWorks.Data.Model.HelperClasses;
using ShipWorks.Shipping.Carriers.iParcel;
using Moq;
using log4net;
using ShipWorks.Data.Model.EntityClasses;
using System.Data;
using System.IO;

namespace ShipWorks.Tests.Shipping.Carriers.iParcel
{
    public class iParcelDatabaseRepositoryTest
    {
        private iParcelDatabaseRepository testObject;

        private Mock<ILog> logger;
        private ShipmentEntity shipment;

        [TestInitialize]
        public void Initialize()
        {
            shipment = new ShipmentEntity
            {
                ShipmentID = 123,
                IParcel = new IParcelShipmentEntity()
            };

            shipment.IParcel.Packages.Add(iParcelShipmentType.CreateDefaultPackage());

            logger = new Mock<ILog>();
            logger.Setup(l => l.Error(It.IsAny<object>(), It.IsAny<Exception>()));

            testObject = new iParcelDatabaseRepository(logger.Object);
        }

        [Fact]
        [Ignore]
        public void SaveLabel_Test()
        {
            // MARKED WITH THE IGNORE ATTRIBTE SINCE THIS ISN'T REALLY A UNIT TEST (DUE
            // TO THE DATABASE DEPENDENCIES). THIS WAS JUST A QUICK CHECK THAT THE IMAGE 
            // LABEL WAS BEING EXTRACTED FROM THE DATASET RESPONSE CORRECTLY PRIOR
            // TO HAVING THE FULL IMPLEMENTATION WORKING END TO END. THIS WILL ALWAYS
            // FAIL UNLESS MANUALLY WALKING THROUGH THE CODE TO BYPASS CODE THAT 
            // INTERACTS WITH THE DATABASE. THIS CAN/SHOULD BE REMOVED ONCE WE HAVE
            // INTEGRATION TESTS IN PLACE.
            StringReader stringReader = new StringReader(GetResponseXml());

            DataSet simulatedResponse = new DataSet();
            simulatedResponse.ReadXml(stringReader, XmlReadMode.Auto);

            testObject.SaveLabel(shipment, simulatedResponse);
        }


        [Fact]
        public void SaveTrackingInfoToEntity_AssignsTrackingNumber_Test()
        {
            // We can unit test this since the repository is not interacting with an external dependency 
            // (i.e. the database) in the SaveTrackingInfoToEntity method
            using (DataSet simulatedResponse = new DataSet())
            {
                using (StringReader stringReader = new StringReader(GetResponseXml()))
                {
                    simulatedResponse.ReadXml(stringReader, XmlReadMode.Auto);
                    testObject.SaveTrackingInfoToEntity(shipment, simulatedResponse);
                }
            }

            Assert.AreEqual("634986177870945805", shipment.TrackingNumber);
        }

        [Fact]
        public void SaveTrackingInfoToEntity_AssignsParcelNumber_Test()
        {
            // We can unit test this since the repository is not interacting with an external dependency 
            // (i.e. the database) in the SaveTrackingInfoToEntity method
            using (DataSet simulatedResponse = new DataSet())
            {
                using (StringReader stringReader = new StringReader(GetResponseXml()))
                {
                    simulatedResponse.ReadXml(stringReader, XmlReadMode.Auto);
                    testObject.SaveTrackingInfoToEntity(shipment, simulatedResponse);
                }
            }

            Assert.AreEqual("216062095", shipment.IParcel.Packages[0].ParcelNumber);
        }

