                      <xs:element name=""PackageTotalUSD"" type=""xs:string"" minOccurs=""0"" />
                      <xs:element name=""PackageTotalCurrency"" type=""xs:string"" minOccurs=""0"" />
                      <xs:element name=""PackageInsurance"" type=""xs:string"" minOccurs=""0"" />
                      <xs:element name=""DimWeight"" type=""xs:string"" minOccurs=""0"" />
                      <xs:element name=""DimWeightApplied"" type=""xs:string"" minOccurs=""0"" />
                    </xs:sequence>
                  </xs:complexType>
                </xs:element>
                <xs:element name=""LabelInfo"" minOccurs=""0"" maxOccurs=""unbounded"">
                  <xs:complexType>
                    <xs:sequence>
                      <xs:element name=""ParcelLabelBase64"" type=""xs:string"" minOccurs=""0"" />
                      <xs:element name=""ParcelLabelLink"" type=""xs:string"" minOccurs=""0"" />
                    </xs:sequence>
                  </xs:complexType>
                </xs:element>
